  false,\n\t\"url\": null,\n\t\"notes\": \"The Oceanographic Survey in Support of
  Fishing off the Coast of Portugal (CAPEC) consists of several cruises to obtain,
  systemically, physical, chemical and biological seasonal data of the coastal area
  between Caminha and Vila Real de Santo Antonio. Its geographical limits lie between
  10 .30 W, on the west coast, and the parallel 36 .15 N, on the South coast.nnThe
  third cruise of the Oceanographic Survey in Support of Fishing off the Coast of
  Portugal, CAPEC III, collected oceanographic data describing a winter situation.
  This survey was accomplished aboard the N. R. P. S. JORGE between April 30, and
  May 23, 1971.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
